        static string bank_verification_base64(string apiToken_account, string agency, string account, string account_type, string bank, string document)
        { 
        
            HttpClient client = new HttpClient();
            client.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", Convert.ToBase64String(System.Text.ASCIIEncoding.ASCII.GetBytes(apiToken_account)));
            string URI =  "https://api.iugu.com/v1/bank_verification";

            var bank_validation = new
            {
                agency = agency,
                account = account,
                account_type = account_type,
                bank = bank,
                document = document
            };

            HttpResponseMessage response = client.PostAsJsonAsync(URI, bank_validation).Result;


             if (response.IsSuccessStatusCode)
             {
                  
                 return  response.Content.ReadAsStringAsync().Result;
             }
             else
             {
                 return response.ReasonPhrase;
             }



        }
         
        static string bank_verification_multipart(string apiToken_account, string agency, string account, string account_type, string bank, string document)
        {

            HttpClient client = new HttpClient();
            client.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", Convert.ToBase64String(System.Text.ASCIIEncoding.ASCII.GetBytes(apiToken_account)));
            string URI = "https://api.iugu.com/v1/bank_verification";


            using (var multipartFormDataContent = new MultipartFormDataContent())
            {
                var values = new[]
                            { 
                                new KeyValuePair<string, string>("agency", agency),
                    new KeyValuePair<string, string>("account", account),
                    new KeyValuePair<string, string>("account_type", account_type),
                    new KeyValuePair<string, string>("bank", bank), 

                            };

                foreach (var keyValuePair in values)
                {
                    multipartFormDataContent.Add(new StringContent(keyValuePair.Value),
                        String.Format("\"{0}\"", keyValuePair.Key));
                }

                multipartFormDataContent.Add(new ByteArrayContent(System.IO.File.ReadAllBytes(document)),
                    '"' + "document" + '"',
                    '"' + "test1.png" + '"');


                HttpResponseMessage response = client.PostAsync(URI, multipartFormDataContent).Result; ;


                if (response.IsSuccessStatusCode)
                {

                    return response.Content.ReadAsStringAsync().Result;
                }
                else
                {
                    return response.ReasonPhrase;
                }
            }

        }
          
        static string request_verification_base64(string id_account,
                                                          string apiToken_account,
                                                          string price_range = "",
                                                          string physical_products = "false",
                                                          string business_type = "",
                                                          string person_type = "Pessoa Jurídica",
                                                          string automatic_transfer = "true",
                                                          string cnpj = "",
                                                          string company_name = "",
                                                          string address = "",
                                                          string cep = "",
                                                          string city = "",
                                                          string state = "",
                                                          string telephone = "",
                                                          string resp_name = "",
                                                          string resp_cpf = "",
                                                          string bank = "",
                                                          string bank_ag = "",
                                                          string account_type = "",
                                                          string bank_cc = "",
                                                          string file_id = "",
                                                          string file_cpf = "",
                                                          string file_activity = ""

          )
        {
             
            HttpClient client = new HttpClient();
            client.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", Convert.ToBase64String(System.Text.ASCIIEncoding.ASCII.GetBytes(apiToken_account)));
            string URI = "https://api.iugu.com/v1/accounts/" + id_account + "/request_verification";


            var request_verification = new
            {
                data = new
                {
                    price_range = price_range,
                    physical_products = physical_products,
                    business_type = business_type,
                    person_type = person_type,
                    automatic_transfer = automatic_transfer,
                    cnpj = cnpj,
                    company_name = company_name,
                    cpf = "",
                    name = "",
                    address = address,
                    cep = cep,
                    city = city,
                    state = state,
                    telephone = telephone,
                    resp_name = resp_name,
                    resp_cpf = resp_cpf,
                    bank = bank,
                    bank_ag = bank_ag,
                    account_type = account_type,
                    bank_cc = bank_cc,
                },
                files = new
                {
                    id = file_id,
                    cpf = file_cpf,
                    activity = file_activity,
                }
            };

             
            HttpResponseMessage response = client.PostAsJsonAsync(URI, request_verification).Result;


            if (response.IsSuccessStatusCode)
            {

                return response.Content.ReadAsStringAsync().Result;
            }
            else
            {
                return response.ReasonPhrase;
            }
             

        }

